import reqMessage from "./reqMessage";

var myGlobalvalues = {
    islocal: true,  // 로컬, 원격
    isadmin: true, // 관리자, 사용자
    reqmsg: new reqMessage("aaa")
  }
  
export default myGlobalvalues;
